import React, { useState } from 'react';
import { slide as Menu } from 'react-burger-menu';
import './Sidebar.css';
import { Link } from "react-router-dom";

export default props => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuOpen = () => {
    setIsMenuOpen(true);
  }

  const handleMenuClose = () => {
    setIsMenuOpen(false);
  }

  return (
    <Menu isOpen={isMenuOpen} onStateChange={({ isOpen }) => setIsMenuOpen(isOpen)}>
      <Link to="/" className="menu-item" onClick={handleMenuClose}>
        Home
      </Link>
      <Link to="/Education" className="menu-item" onClick={handleMenuClose}>
        Education
      </Link>
      <Link to="/Experience" className="menu-item" onClick={handleMenuClose}>
        Experience
      </Link>
      <Link to="/Projects" className="menu-item" onClick={handleMenuClose}>
        Projects</Link>
      <Link to="/InterestsActivities" className="menu-item" onClick={handleMenuClose}>
        Interests & Activities
      </Link>
    </Menu>
  );
};
